var lockedNodes = ['41882', '41877', '41872'];

// Define the layouts
var layouts = [
  {
    name: 'circle',
    animate: true
  },
  {
    name: 'grid',
    animate: true
  },
  {
    name: 'concentric',
    minNodeSpacing: 10,
    padding: 50,
    animationDuration: 1500,
    animate: true
  },
  {
    name: 'cola',
    nodeSpacing: 2,
    animate: true
  },
  {
    name: 'preset',
    animate: true
  }
]

// Set the initial conditions to display
var currentDataset = 0;
var currentLayout = 4;

var saveAsSvg = function(cy, filename) {
  var svgContent = cy.svg({scale: 2, full: true});
  var blob = new Blob([svgContent], {type:"image/svg+xml;charset=utf-8"});
  saveAs(blob, filename);
};

var getSvgUrl = function(cy) {
  var svgContent = cy.svg({scale: 2, full: true});
  var blob = new Blob([svgContent], {type:"image/svg+xml;charset=utf-8"});
  var url = URL.createObjectURL(blob);
  return url;
};

var saveAsPng = function(cy, filename) {
  var pngContent = cy.png({
    scale: 10, // increase the scale to double the resolution
    full: true // capture the full viewport
  });
  var blob = dataURLtoBlob(pngContent);
  saveAs(blob, filename);
};

// Utility function to convert a data URL to a Blob object
function dataURLtoBlob(dataURL) {
  var binary = atob(dataURL.split(',')[1]);
  var array = [];
  for (var i = 0; i < binary.length; i++) {
    array.push(binary.charCodeAt(i));
  }
  return new Blob([new Uint8Array(array)], {type: 'image/png'});
}


// Function to load a new dataset
function loadDataset(index, index_layout) {
  var dataset = datasets[index];

  var cy = window.cy = cytoscape({
      container: document.getElementById('cy'),
      elements: {
          nodes: dataset.nodes,
          edges: dataset.edges
      },
      style: dataset.style,
      layout: {name: 'preset'}
  });

  if (!dataset.initialPositions) {
    // Save the initial positions of the nodes
    dataset.initialPositions = {};
    cy.nodes().forEach(function(node) {
      dataset.initialPositions[node.id()] = {
        x: node.position('x'),
        y: node.position('y')
      };
    });
  }

  if (index_layout === "4") {
    // Load the initial positions of the nodes for the custom layout
    cy.nodes().forEach(function(node) {
      var id = node.id();
      if (dataset.initialPositions.hasOwnProperty(id)) {
        node.position(dataset.initialPositions[id]);
      }
    });
    cy.fit();
  } else {
    var layout = layouts[index_layout];
    if (lockedNodes.length > 0){
      cy.nodes().forEach(function(node) {
        var id = node.id();
        if (lockedNodes.includes(id)) {
          node.remove();
        }
      });
    }
    cy.layout(layout).run();
  }
  return cy;
}

$(document).ready(function() {
  var cy = loadDataset(currentDataset, currentLayout);
});

// Event listener for the dataset selector dropdown
$('#dataset-select').on('change', function() {
  currentDataset = $(this).val();
  currentLayout = $('#layout-select').val();  // get selected layout
  var cy = loadDataset(currentDataset, currentLayout);
});

// Event listener for the layout selector dropdown
$('#layout-select').on('change', function() {
  currentDataset = $('#dataset-select').val();  // get selected dataset
  currentLayout = $(this).val();
  var cy = loadDataset(currentDataset, currentLayout);
});

// Event listener for the save button
$('#save-button').on('click', function() {
  saveAsSvg(cy, 'network.svg');
});

